prism.theme.builder.Builder.prototype.getViewTheme=function(){return this.viewTheme};prism.theme.builder.Builder.prototype.getLanguages=function(){return this.languages};prism.theme.builder.Builder.prototype.getTokens=function(){return this.tokens};prism.theme.builder.Builder.prototype.updateToken=function(name,style){if(this.canUpdateToken()){this.currentToken.setStyle(name,style);this.update()}};
